import React, {Component} from 'react';
import baseService from "../services/baseService";

export default class Logout extends Component {
    componentWillMount() {

        baseService.logout();
        this.props.history.push('/login')
    }


    render() {
        this.props.history.push('/login');
        return (null);
    }
}
